import { Route, Switch } from "react-router-dom";
import { Helmet } from "react-helmet-async";
import './App.css';
import { routes } from "./routes"
import Home from "./pages/Home";
import Walking from './pages/Walking';
import Rain from "./pages/Rain";
import FunkySnake from './pages/FunkySnake';


function App() {
  return (
    <>
      <Helmet>
        <meta charSet="utf-8" />
        <title>Github Pages - Floris Veldhuizen</title>
        <link rel="icon" href="data:image/svg+xml,<svg xmlns=%22http://www.w3.org/2000/svg%22 viewBox=%220 0 100 100%22><text y=%22.9em%22 font-size=%2290%22>ðŸ¦¥</text></svg>" />
      </Helmet>
      <Switch>
        <Route exact path={routes.home} component={Home} />
        <Route path={routes.walking} component={Walking} />
        <Route path={routes.rain} component={Rain} />
        <Route path={routes.funkySnake} component={FunkySnake} />
      </Switch>
    </>
  );
}

export default App;
